<p><strong>技术栈</strong>:</p>
<ul>
<li>
<p><strong>后端</strong>：<code>SpringBoot 3</code>+ <code>MySQL</code> + <code>mybatis-plus</code> + <code>Redis</code> + <code>RabbitMQ</code> + <code>Jwt</code>（基于Token的权限校验）</p>
